function zendeskDepartments() {
    var zendesk_departments = {}
    var countries = []

    for (const [key, value] of Object.entries(departments)) {
        for (const item of value) {
            if (!countries.includes(item.country)) {
                countries.push(item.country)
            }
        }
    }

    for (const [key, value] of Object.entries(departments)) {
        zendesk_departments[key] = departmentFilteredList(value, countries);
    }
    return zendesk_departments;
}

function departmentFilteredList(list, countries) {
    var filteredList = []

    for (var country of countries) {
        filteredList.push({
            country: country,
            ids: []
        })
    }

    for (var element of list) {
        const elementID = isStaging() ? element['id_staging'] : element['id'];
        const filteredListItem = filteredList.find(x => x.country === element.country);
        if (typeof (filteredListItem) !== 'undefined') {
            filteredListItem.ids.push(elementID)
        }
    }
    return filteredList;
}

function isStaging() {
    const currentUrl = window.location.origin;
    const sandboxURL = 'https://gympasshelp1633549875.zendesk.com';
    return currentUrl === sandboxURL;
}

window.zendesk_departments = zendeskDepartments();
;"use strict";
var zendeskData = {};
var zendeskScript = "//static.zdassets.com/ekr/asset_composer.js";

function gympassInitZendesk(options) {
	zendeskData = options
	zendeskData.host_url = zendeskData.hasOwnProperty('host_url') ? zendeskData.host_url : "gympasshelp.zendesk.com";
	if (!window.zendesk_initialized) {
		startZendesk();
		window.zendesk_initialized = true;
	}
}

function startZendesk() {
	if(paramsValid()){
		zendeskWebWidget();
		setZendeskCustom();
		initDepartments();
		defineDepartmentsFromTribesAndCountry()
		defineTranslations();
		changeOffsetZendesk();
		filterZendeskDepartments();
		addTagZendeskChat();
		setVisibility();
		hideChatbotWhenActivated();
		removeDoubleWidget()
	
		//only runs on core, dont know what it
		if('undefined' !== typeof jQuery){
			$(document).on("click", ".zendesk_chat_button", function () {
				window.zE.activate();
			});
		}
	}else{
		console.error("params invalid did not start zendesk")
	}
}

function paramsValid() {
	let params_valid = true
	if(zendeskData.country === null){
		params_valid = false
		console.error("zendesk country not defined")
	}

	if(zendeskData.departments === null && zendeskData.tribes === null){
		params_valid = false
		console.error("zendesk departments or tribes not defined")
	}
	return params_valid
}


function zendeskWebWidget() {
	window.zEmbed = window.zE = null;
	window.$zopim = undefined;

	(function (url, host) {
		var queue = [];
		var dom;
		var doc;
		var where;
		var iframe = document.createElement("iframe");
		var iframeWindow;
		var iframeDocument;

		window.zEmbed = function zEmbed() {
			queue.push(arguments);
		};

		window.zE = window.zE || window.zEmbed;

		iframe.title = "";
		iframe.role = "presentation";
		iframe.src = "javascript:false";
		(iframe.frameElement || iframe).style.cssText = "display: none";

		where = document.querySelectorAll("script");
		where = where[where.length - 1];
		where.parentNode.insertBefore(iframe, where);

		iframeWindow = iframe.contentWindow;
		iframeDocument = iframeWindow.document;

		try {
			doc = iframeDocument;
		} catch (error) {
			dom = document.domain;
			iframe.src =
				'javascript:var d=document.open();d.domain="' +
				dom +
				'";void(0);';
			doc = iframeDocument;
		}

		doc.open()._l = function _l() {
			var js = this.createElement("script");

			js.id = "js-iframe-async";
			js.src = url;

			this.t = Number(new Date());
			this.zendeskHost = host;
			this.zEQueue = queue;
			this.domain = dom ? dom : this.domain;

			this.body.appendChild(js);
		};

		doc.write('<body onload="document._l();">');
		doc.close();
	})(zendeskScript, zendeskData.host_url);
}

function setZendeskCustom() {
	zE(function () {
		zE.setLocale(zendeskData.locale);

		if (zendeskData && zendeskData.user && zendeskData.user.email) {
			zE.identify({ name: zendeskData.user.name, email: zendeskData.user.email });
		}
	});
}

function initDepartments() {
	zE(function () {
		setTimeout(function () {
			try {
				if (window.$zopim) {
					window.$zopim.livechat.departments.getAllDepartments();
				}
			} catch (e) {
				console.error(
					"Chatbot Exception: error trying to get all departments."
				);
			}
		}, 2000);
	});
}

function defineDepartmentsFromTribesAndCountry() {
	const departmentsTribesList = window.zendesk_departments;
	if(zendeskData.tribes && zendeskData.country){
		let tribes_departments = []
		for (var i = 0; i < zendeskData.tribes.length; i++) {
			const tribe = zendeskData.tribes[i]
			const tribe_countries = departmentsTribesList[tribe]
			for (var j = 0; j < tribe_countries.length; j++) {
				const tribe_country = tribe_countries[j]
				if(tribe_country.country === zendeskData.country){
					tribes_departments = [...tribes_departments, ...tribe_country.ids]
				}
			}
		}
		zendeskData.departments = tribes_departments;
	}
} 

