function changeOffsetZendesk() {
	if (zendeskData.email) {
		var settings = {
			webWidget: {
				offset: {
					mobile: {
						horizontal: "0px",
						vertical: "50px",
					},
				},
			},
		};

		if (zendeskData.is_hr_portal_chat) {
			settings.webWidget.position = {
				horizontal: "left",
				vertical: "bottom",
			};
		}

		window.zESettings = settings;
	}
}

function filterZendeskDepartments() {
	if(zendeskData.departments){
		zE(function () {
			$zopim(function () {
				//weird function, doenst work if you pass a vector, this way only show to a max of 6 departments
				$zopim.livechat.departments.filter(
					typeof zendeskData.departments[0] != 'undefined' ? zendeskData.departments[0] : "",
					typeof zendeskData.departments[1] != 'undefined' ? zendeskData.departments[1] : "",
					typeof zendeskData.departments[2] != 'undefined' ? zendeskData.departments[2] : "",
					typeof zendeskData.departments[3] != 'undefined' ? zendeskData.departments[3] : "",
					typeof zendeskData.departments[4] != 'undefined' ? zendeskData.departments[4] : "",
					typeof zendeskData.departments[5] != 'undefined' ? zendeskData.departments[5] : ""
				);
				//set default deparment
				if(typeof zendeskData.departments[0] != 'undefined'){
					$zopim.livechat.departments.setVisitorDepartment(zendeskData.departments[0]);
				}
			});
		});
	}
}

function addTagZendeskChat() {
	zE(function () {
		$zopim(function () {
			if (zendeskData.tags) {
				var tags = zendeskData.tags.split(",");

				tags.forEach(function (tag) {
					$zopim.livechat.addTags(tag.trim());
				});
			}
		});
	});
}

function setVisibility() {
	if (zendeskData.is_hr_portal_chat || (zendeskData.is_default_zendesk_page != null && !zendeskData.is_default_zendesk_page )) {
		zE("webWidget", "hide");
	}
}

function hideChatbotWhenActivated() {
	var chatbotLauncher = document.querySelector(".inbenta-bot__launcher");
	if(chatbotLauncher){
		zE(function () {
			$zopim(function () {
				$zopim.livechat.window.onShow(function () {
					chatbotLauncher.addClass("hidden");
				});
	
				$zopim.livechat.window.onHide(function () {
					chatbotLauncher.removeClass("hidden");
				});
			});
		});
	}
}

document.addEventListener("click", function documentClickHandle(event) {
	var target = event.target;
	var shouldTriggerClick =
		target && target.classList.contains("zendesk_chat_button");

	if (shouldTriggerClick) {
		zE.activate();
	}
});

// Remove one widget if there were two rendered.
// only used in core or pages with jquery
function removeDoubleWidget() {
	if('undefined' !== typeof jQuery){
		var removeWidgetInterval = setInterval(function () {
			if (
				$("div").find("#webWidget").length === 2 &&
				$("div").find("#launcher").length === 2
			) {
				var widget_to_delete = $("div").find("#webWidget");
				var launcher_to_delete = $("div").find("#launcher");
				launcher_to_delete.last().remove();
				widget_to_delete.last().remove();
				clearInterval(removeWidgetInterval);
			}
		}, 1000);
	}
}

