function createChatbotPropertiesDiv(dataUserInfo){
	document.getElementById("chatbot-properties").outerHTML = "";
	const elemDiv = document.createElement("div");
	elemDiv.setAttribute("id", "chatbot-properties");
	elemDiv.setAttribute("data-enabled", true);
	elemDiv.setAttribute("data-user-info", JSON.stringify(dataUserInfo));
	document.body.appendChild(elemDiv);
};

//inbenta sdk does not validate when the client doesnt send data-user-info and breaks the code
//this is a fix to create the properties values stoping the sdk conf from breaking
//this is used to fix gympass.com page when user not loged-in 
function noDataUserInfoFix(){
	var chatbot_properties = document.querySelector("#chatbot-properties");
	if (chatbot_properties && chatbot_properties.dataset && chatbot_properties.dataset.userInfo == "") {
		console.log("user-info empty")
		createChatbotPropertiesDiv(
			{ user: { type: null, name: null, email: null } },
			null
		);
	}
};

function appendCountryToBody(country){
	if (country) {
		document.body.setAttribute("data-ct", country);
	}
};

function appendUserDataToBody(options){
	//only create div if all user data is in user(type, name, email)
	//if user data does not has a type, a div in the page with the user info(type, name, email) must exist
	if (options && options.user && options.user.type && options.user.name && options.user.email) {
		const chatbotPropertiesInBody = document.querySelector(
			"#chatbot-properties"
		);
		if (options && !chatbotPropertiesInBody) {
			createChatbotPropertiesDiv(options.user);
		}
	}
};

function setSdkWithOptions(options) {
	appendCountryToBody(options.country);
	appendUserDataToBody(options);
};

function chatbotSdkInit(options) {
	if (window.gympassInitZendesk) {
		window.gympassInitZendesk(options);
	}else{
		console.log("window.gympassInitZendesk function not declared")
	}

  const CHATBOT_DISALLOWED_HOSTS = [
    'www.gympass.com'
  ];
  if (CHATBOT_DISALLOWED_HOSTS.includes(window.location.host)) {
    console.info('Chatbot is disallowed to run in this host');
    return;
  }

	if (options && options.enabled) {
			setSdkWithOptions(options);

			noDataUserInfoFix();
	
			var country =
				options && options.country
					? options.country
					: document.querySelector("body").getAttribute("data-ct");
			
			var tribes = 
				options && options.tribes
					? options.tribes
					: [];

			if (
				country == "br" ||
				(tribes.includes("user") && (country == "us" || country == "es"))
			) {
				loadLegacyChatbot();
			}
	}else{
		console.log("options not declared or chatbot not enabled")
	}
}

window.chatbotSdkInit = chatbotSdkInit;
;function zendeskFix(){
	//dont know why this is necessary in core
	//might be removed in future
	$('head iframe[src="javascript:false"]').remove();
};

function init(){
	var chatbot_props = document.querySelector("#chatbot-properties");
	var chatbot_properties = chatbot_props ? chatbot_props.dataset : null;
	console.log("Init chatbot with params", chatbot_properties);
	window.zendesk_initialized = false;
	var $zendeskAttribs = $("zendesk-attribs");
	zendeskFix();

	const options = {
			user: {
				name: $zendeskAttribs.attr("name"),
				email: $zendeskAttribs.attr("email"),
			},
			enabled: chatbot_properties && chatbot_properties.enabled ? chatbot_properties.enabled : false,
			departments: $zendeskAttribs.attr("departments"),
			country: document.querySelector("body").getAttribute("data-ct"),
			locale: $zendeskAttribs.attr("locale"),
			tags: $zendeskAttribs.attr("tags"),
			is_hr_portal_chat:
				$zendeskAttribs.attr("is_hr_portal_chat") === "true",
			is_default_zendesk_page:
				$zendeskAttribs.attr("is_default_zendesk_page") === "true",
	};
	window.chatbotSdkInit(options);
};

